import React from "react";
import { useLocation } from "react-router-dom";
import "./chatbot.css";

function Chatbot() {
  const location = useLocation();
  const { selectedField, response } = location.state || {};  // Destructure state from location

  return (
    <main>
      <nav className="outer-col-1">Navigation</nav>
      <div className="outer-col-2">
        <header>Header</header>
            <h2>Selected Field: {selectedField || "None"}</h2>
        <div className="inner-row">
          <div className="inner-col">
            <article>
              <p>Response: {response || "Loading..."}</p>
            </article>
            <footer>Footer</footer>
          </div>
          <aside>Aside</aside>
        </div>
      </div>
    </main>
  );
}

export default Chatbot;
